import React from 'react';
import { BUTTON_PRIMARY,
         BUTTON_LIGHT,
         BUTTON_GRAY,
         BUTTON_TRANSPARENT,
          } from '../../../Styles/Button'
         
         const CARD_SHADOW = {
            innerHeight: '50px',
            innerWidth: '50px',
            borderRadius: '10px',
            width : 'auto',
            length: 'auto',
            'box-shadow': '0px 13px 26px rgb(109,184,241, 0.16)',
          };
          

const Hea = () => {

        return (
            <div style={CARD_SHADOW}>
                <h1> Health </h1>
                <button style={BUTTON_PRIMARY}> hello </button>
                <button style={BUTTON_LIGHT}> hello </button>
                <button style={BUTTON_GRAY}> hello </button>
                <button style={BUTTON_TRANSPARENT}> hello </button>
            </div>
            )
        }
  

export default Hea ;
